"use strict";(self.webpackChunktemp_docusaurus=self.webpackChunktemp_docusaurus||[]).push([[3932],{2527:a=>{a.exports=JSON.parse('{"version":{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","label":"Panduan Pengguna","href":"/id/docs/intro","docId":"intro","unlisted":false},{"type":"category","label":"Untuk Pemain Go","collapsible":true,"collapsed":true,"items":[{"type":"category","label":"Bagian Pemula","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Aturan Go","href":"/id/docs/for-players/introduction/rules","docId":"for-players/introduction/rules","unlisted":false},{"type":"link","label":"Terminologi Go","href":"/id/docs/for-players/introduction/terminology","docId":"for-players/introduction/terminology","unlisted":false},{"type":"link","label":"Etiket Bermain","href":"/id/docs/for-players/introduction/etiquette","docId":"for-players/introduction/etiquette","unlisted":false},{"type":"link","label":"Konsep Pembukaan","href":"/id/docs/for-players/introduction/first-10-moves","docId":"for-players/introduction/first-10-moves","unlisted":false}],"href":"/id/docs/for-players/introduction/"},{"type":"category","label":"Era AI","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Perubahan yang Dibawa AI","href":"/id/docs/for-players/ai-era/changes","docId":"for-players/ai-era/changes","unlisted":false},{"type":"link","label":"Belajar Go dengan AI","href":"/id/docs/for-players/ai-era/learning-with-ai","docId":"for-players/ai-era/learning-with-ai","unlisted":false}],"href":"/id/docs/for-players/ai-era/"}],"href":"/id/docs/for-players/"},{"type":"category","label":"Panduan AI Go untuk Insinyur","collapsible":true,"collapsed":true,"items":[{"type":"category","label":"Latar Belakang Pengetahuan","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Pembahasan Makalah AlphaGo","href":"/id/docs/for-engineers/background-info/alphago","docId":"for-engineers/background-info/alphago","unlisted":false},{"type":"link","label":"Pembahasan Makalah KataGo","href":"/id/docs/for-engineers/background-info/katago-paper","docId":"for-engineers/background-info/katago-paper","unlisted":false},{"type":"link","label":"Pengenalan AI Go Lainnya","href":"/id/docs/for-engineers/background-info/zen","docId":"for-engineers/background-info/zen","unlisted":false}],"href":"/id/docs/for-engineers/background-info/"},{"type":"category","label":"Panduan Praktis KataGo","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Instalasi dan Konfigurasi","href":"/id/docs/for-engineers/katago-source/setup","docId":"for-engineers/katago-source/setup","unlisted":false},{"type":"link","label":"Perintah Umum","href":"/id/docs/for-engineers/katago-source/commands","docId":"for-engineers/katago-source/commands","unlisted":false},{"type":"link","label":"Arsitektur Kode Sumber","href":"/id/docs/for-engineers/katago-source/architecture","docId":"for-engineers/katago-source/architecture","unlisted":false}],"href":"/id/docs/for-engineers/katago-source/"}],"href":"/id/docs/for-engineers/"},{"type":"category","label":"Ringkasan Evolusi AI Go","collapsible":true,"collapsed":true,"items":[{"type":"category","label":"Sejarah Perkembangan Go Manusia","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Go Kuno","href":"/id/docs/evolution/human-history/ancient","docId":"evolution/human-history/ancient","unlisted":false},{"type":"link","label":"Go Modern","href":"/id/docs/evolution/human-history/japan-china-korea","docId":"evolution/human-history/japan-china-korea","unlisted":false}],"href":"/id/docs/evolution/human-history/"},{"type":"category","label":"Sejarah Perkembangan AI Go","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Era AlphaGo","href":"/id/docs/evolution/ai-history/alphago-era","docId":"evolution/ai-history/alphago-era","unlisted":false},{"type":"link","label":"Era KataGo","href":"/id/docs/evolution/ai-history/katago-era","docId":"evolution/ai-history/katago-era","unlisted":false}],"href":"/id/docs/evolution/ai-history/"}],"href":"/id/docs/evolution/"},{"type":"link","label":"Tentang Kami","href":"/id/docs/aboutus","docId":"aboutus","unlisted":false}]},"docs":{"aboutus":{"id":"aboutus","title":"Tentang Kami","description":"Kami adalah Asosiasi Go Taiwan yang berkomitmen untuk mempromosikan budaya permainan Go. Konten lebih lanjut akan segera diperbarui.","sidebar":"tutorialSidebar"},"evolution/ai-history/alphago-era":{"id":"evolution/ai-history/alphago-era","title":"Era AlphaGo","description":"Tahun 2015 hingga 2017, seri program AlphaGo dari Google DeepMind menciptakan salah satu terobosan paling ikonik dalam sejarah kecerdasan buatan. Dalam waktu singkat dua tahun, Go berubah dari \\"permainan yang tidak bisa ditaklukkan kecerdasan buatan\\" menjadi \\"bidang di mana AI sepenuhnya melampaui manusia\\".","sidebar":"tutorialSidebar"},"evolution/ai-history/index":{"id":"evolution/ai-history/index","title":"Sejarah Perkembangan AI Go","description":"Untuk waktu yang lama, Go dianggap sebagai permainan paling sulit ditaklukkan oleh kecerdasan buatan. Papan dengan 19\xd719 = 361 titik persimpangan, setiap titik dapat diisi, jumlah variasi melebihi total atom di alam semesta (sekitar 10^170 kemungkinan permainan). Metode pencarian brute-force tradisional sama sekali tidak efektif menghadapi Go.","sidebar":"tutorialSidebar"},"evolution/ai-history/katago-era":{"id":"evolution/ai-history/katago-era","title":"Era KataGo","description":"Setelah AlphaGo pensiun pada tahun 2017, perkembangan AI Go tidak berhenti. Sebaliknya, komunitas open source mengambil alih estafet, membuat AI Go tingkat atas bukan lagi hak eksklusif raksasa teknologi, melainkan alat yang dapat digunakan setiap orang. Gerakan \\"demokratisasi AI\\" ini secara total mengubah cara belajar dan berlatih Go.","sidebar":"tutorialSidebar"},"evolution/human-history/ancient":{"id":"evolution/human-history/ancient","title":"Go Kuno","description":"Sejarah Go dapat ditelusuri hingga ribuan tahun yang lalu di Tiongkok, merupakan salah satu permainan papan tertua umat manusia. Ini bukan hanya permainan kecerdasan, tetapi juga membawa kandungan budaya yang mendalam, mencerminkan esensi filsafat Timur tentang yin-yang, keseimbangan, dan pemikiran strategis.","sidebar":"tutorialSidebar"},"evolution/human-history/index":{"id":"evolution/human-history/index","title":"Sejarah Perkembangan Go Manusia","description":"Go adalah salah satu permainan papan tertua dan paling mendalam dalam sejarah manusia. Dari legenda asal-usul di Tiongkok kuno, melalui ribuan tahun perkembangan, Go tidak hanya menjadi permainan, tetapi juga bagian penting dari budaya Asia Timur, membawa makna ganda filsafat, seni, dan kompetisi.","sidebar":"tutorialSidebar"},"evolution/human-history/japan-china-korea":{"id":"evolution/human-history/japan-china-korea","title":"Go Modern","description":"Dari pembentukan empat rumah besar Jepang pada abad ke-17, hingga persaingan Tiongkok-Korea pada abad ke-21, Go modern mengalami transformasi penting profesionalisasi dan internasionalisasi. Periode sejarah ini menyaksikan proses Go berkembang dari seni tradisional Timur menjadi olahraga kompetitif global.","sidebar":"tutorialSidebar"},"evolution/index":{"id":"evolution/index","title":"Ringkasan Evolusi AI Go","description":"Mengapa AI Mengubah Go?","sidebar":"tutorialSidebar"},"for-engineers/background-info/alphago":{"id":"for-engineers/background-info/alphago","title":"Pembahasan Makalah AlphaGo","description":"Artikel ini menganalisis secara mendalam makalah klasik yang diterbitkan DeepMind di Nature \\"Mastering the game of Go with deep neural networks and tree search\\", serta makalah lanjutan AlphaGo Zero dan AlphaZero.","sidebar":"tutorialSidebar"},"for-engineers/background-info/index":{"id":"for-engineers/background-info/index","title":"Latar Belakang Pengetahuan","description":"Sebelum masuk ke praktik KataGo, memahami sejarah perkembangan dan teknologi inti AI Go sangat penting. Bab ini akan membawa Anda memahami evolusi teknis dari AlphaGo hingga AI Go modern.","sidebar":"tutorialSidebar"},"for-engineers/background-info/katago-paper":{"id":"for-engineers/background-info/katago-paper","title":"Pembahasan Makalah KataGo","description":"KataGo dikembangkan oleh David Wu, makalahnya \\"Accelerating Self-Play Learning in Go\\" diterbitkan pada tahun 2019. KataGo mencapai kemampuan bermain yang melampaui ELF OpenGo dengan sumber daya komputasi lebih sedikit, menjadi AI Go open source terkuat saat ini.","sidebar":"tutorialSidebar"},"for-engineers/background-info/zen":{"id":"for-engineers/background-info/zen","title":"Pengenalan AI Go Lainnya","description":"Selain AlphaGo dan KataGo, bidang AI Go masih memiliki banyak proyek penting. Artikel ini akan memperkenalkan AI komersial dan open source utama, membantu Anda memahami seluruh ekosistem.","sidebar":"tutorialSidebar"},"for-engineers/index":{"id":"for-engineers/index","title":"Panduan AI Go untuk Insinyur","description":"Selamat datang di area dokumentasi teknis AI Go! Di sini kami menyediakan sumber daya teknis dan panduan lengkap untuk insinyur dan developer yang ingin memahami secara mendalam, menerapkan, atau mengembangkan AI Go.","sidebar":"tutorialSidebar"},"for-engineers/katago-source/architecture":{"id":"for-engineers/katago-source/architecture","title":"Arsitektur Kode Sumber","description":"Artikel ini menganalisis secara mendalam struktur kode sumber KataGo, membantu Anda memahami implementasi internalnya. Baik Anda ingin berkontribusi kode, memodifikasi fitur, atau menerapkan teknologinya ke proyek Anda sendiri, ini adalah referensi wajib baca.","sidebar":"tutorialSidebar"},"for-engineers/katago-source/commands":{"id":"for-engineers/katago-source/commands","title":"Perintah Umum","description":"Artikel ini memperkenalkan dua mode operasi utama KataGo: protokol GTP dan Analysis Engine, serta penjelasan detail perintah yang umum digunakan.","sidebar":"tutorialSidebar"},"for-engineers/katago-source/index":{"id":"for-engineers/katago-source/index","title":"Panduan Praktis KataGo","description":"Bab ini akan membimbing Anda dari instalasi hingga penggunaan KataGo yang sebenarnya, mencakup semua pengetahuan operasi praktis. Baik Anda ingin mengintegrasikan KataGo ke aplikasi Anda sendiri, atau ingin meneliti kode sumbernya secara mendalam, ini adalah titik awal Anda.","sidebar":"tutorialSidebar"},"for-engineers/katago-source/setup":{"id":"for-engineers/katago-source/setup","title":"Instalasi dan Konfigurasi","description":"Artikel ini akan menjelaskan secara detail cara menginstal KataGo di berbagai platform, termasuk kebutuhan sistem, langkah instalasi, pemilihan model, dan penjelasan file konfigurasi.","sidebar":"tutorialSidebar"},"for-players/ai-era/changes":{"id":"for-players/ai-era/changes","title":"Perubahan yang Dibawa AI","description":"Kemunculan AlphaGo tidak hanya mengalahkan pemain manusia terbaik, yang lebih penting adalah mengubah pemahaman kita tentang Go. Banyak konsep yang dulu dianggap \\"akal sehat\\", di bawah analisis AI perlu ditinjau ulang.","sidebar":"tutorialSidebar"},"for-players/ai-era/index":{"id":"for-players/ai-era/index","title":"Era AI","description":"Tahun 2016, AlphaGo mengalahkan juara dunia Lee Sedol, mengejutkan seluruh dunia Go. Sejak saat itu, Go memasuki era AI yang baru.","sidebar":"tutorialSidebar"},"for-players/ai-era/learning-with-ai":{"id":"for-players/ai-era/learning-with-ai","title":"Belajar Go dengan AI","description":"AI adalah alat pembelajaran paling kuat untuk pemain amatir di era ini. Memanfaatkan AI dengan baik dapat sangat mempercepat kemajuan Anda; tetapi jika digunakan dengan tidak tepat, justru dapat menghambat pembelajaran. Artikel ini akan memperkenalkan cara menggunakan AI dengan benar untuk membantu pembelajaran.","sidebar":"tutorialSidebar"},"for-players/index":{"id":"for-players/index","title":"Untuk Pemain Go","description":"Selamat datang di area khusus pemain Go! Baik Anda pemula yang baru mengenal Go, maupun penggemar yang ingin meningkatkan keterampilan, di sini tersedia sumber belajar yang cocok untuk Anda.","sidebar":"tutorialSidebar"},"for-players/introduction/etiquette":{"id":"for-players/introduction/etiquette","title":"Etiket Bermain","description":"Go bukan hanya pertarungan menang-kalah, tetapi juga ekspresi budaya dan budi pekerti. Etiket bermain yang baik adalah kualitas dasar yang harus dimiliki setiap pemain.","sidebar":"tutorialSidebar"},"for-players/introduction/first-10-moves":{"id":"for-players/introduction/first-10-moves","title":"Konsep Pembukaan","description":"Pembukaan (juga disebut fuseki) adalah tahap pertama dari pertandingan Go. Tahap ini menentukan arah seluruh permainan. Artikel ini akan memperkenalkan konsep dasar pembukaan, membantu Anda membangun visi menyeluruh yang benar.","sidebar":"tutorialSidebar"},"for-players/introduction/index":{"id":"for-players/introduction/index","title":"Bagian Pemula","description":"Selamat datang di dunia Go! Bagian ini akan membimbing Anda dari nol untuk membangun dasar Go yang kuat.","sidebar":"tutorialSidebar"},"for-players/introduction/rules":{"id":"for-players/introduction/rules","title":"Aturan Go","description":"Aturan Go sangat sederhana, tetapi variasi yang dihasilkan tak terbatas. Inilah daya tarik Go.","sidebar":"tutorialSidebar"},"for-players/introduction/terminology":{"id":"for-players/introduction/terminology","title":"Terminologi Go","description":"Mempelajari terminologi Go dapat membantu Anda memahami catatan permainan, memahami penjelasan, dan berkomunikasi dengan pemain lain.","sidebar":"tutorialSidebar"},"intro":{"id":"intro","title":"Panduan Pengguna","description":"Selamat datang di situs kami! Di sini kami menyediakan sumber daya untuk pemain Go dan insinyur AI. Anda dapat mengakses berbagai topik melalui menu di sebelah kiri.","sidebar":"tutorialSidebar"}}}}')}}]);